import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { useSWRConfig } from 'swr';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
  <useSWRConfig>

    <App />

  </useSWRConfig>
  </React.StrictMode>

);


